What is the output of the following code?

int x = 10;
System.out.println(x++);

What will be the output of the following code?

int a = 5;
int b = 10;
System.out.println(a + b);

What will be the output of the following code?

int[] arr = {1, 2, 3};
System.out.println(arr[1]);

What will be the output of the following code?

for (int i = 0; i < 5; i++) {
    System.out.print(i);
}
